import React, { Component } from 'react';
import { Text, View } from 'react-native';

class Signup extends Component {
	render() {
		return (
			<SafeAreaView style={styles.root}>
				<View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
					<Text>Home</Text>
				</View>
			</SafeAreaView>
		);
	}
}

